INSERT INTO `events` VALUES (1,0,'Corporate Event','Corporate entertainment describes private events held by corporations or businesses for their staff, clients or stakeholders. These events can be for large audiences such as conventions and conferences, or smaller events such as retreats, holiday parties or even private concerts.','image-1699018104232.png','Vijay Nagar','Indore','2023-11-05','19:00','20:59',1500.000000,NULL,'9658745210',0,1,NULL,0,'2023-11-03 13:28:24'),(5,0,'Yoga Day','Yoga Day','image-1699539188485.png','76,Indore','Indore','2023-11-09','19:42','21:42',50.000000,NULL,'9340872510',0,0,NULL,0,'2023-11-09 14:13:08'),(6,0,'test','test','image-1708080299669.png','test','test','2024-01-31','17:04','21:04',125.000000,1,'9658741229',0,0,NULL,0,'2023-11-21 07:33:47'),(9,6,'test','test','image-1706002874219.png','test','test','2024-01-24','19:02','21:04',123.000000,NULL,'9658741230',0,0,1,0,'2024-01-23 09:41:14'),(10,6,'test','test','image-1706598489240.png','test','test','2024-01-30','12:37','13:37',123.000000,NULL,'9658741230',0,0,1,0,'2024-01-30 07:08:09'),(11,26,'testtt','test1','image-1706598970992.png','test1','test1','2024-01-30','12:39','13:40',1231.000000,NULL,'6985741221',0,1,2,0,'2024-01-30 07:16:11'),(12,6,'test','test','image-1706700556862.png','test','test','2024-01-31','16:58','18:00',120.000000,9,'9658741230',0,0,1,0,'2024-01-31 11:29:16'),(13,26,'test','test','image-1706700861479.png','test','test','2024-01-31','17:04','21:04',125.000000,1,'9658741229',0,0,2,0,'2024-01-31 11:34:21'),(14,6,'Seashore Event','The coast, also known as the coastline, shoreline or seashore, is defined as the area where land meets the ocean, or as a line that forms the boundary between the land and the coastline. Shores are influenced by the topography of the surrounding landscape, as well as by water induced erosion, such as waves. The coast, also known as the coastline, shoreline or seashore, is defined as the area where land meets the ocean, or as a line that forms the boundary between the land and the coastline. Shores are influenced by the topography of the surrounding landscape, as well as by water induced erosion, such as waves. The coast, also known as the coastline, shoreline or seashore, is defined as the area where land meets the ocean, or as a line that forms the boundary between the land and the coastline. Shores are influenced by the topography of the surrounding landscape, as well as by water induced erosion, such as waves.','image-1709200513238.png','Indore','India','2024-03-06','09:09','20:09',3456.000000,23,'8085872510',0,0,2,0,'2024-02-29 09:55:13'),(15,6,'House Warming Party 24','Intake of food and eating habits play a major and prime role in the way we live our life and with what kind of lifestyle-healthy or unhealthy. A balanced diet consists of various constituents of food in accurate and appropriate quantity and quality according to the requirement of individual. It is easily digestible and contains appropriate ratio between proteins, fats and carbohydrates that is 1:1:4 for overall development of body in the fit proportion. The diet may vary from person to person according to the body requirements as per consultation from a dietician or family doctor.Intake of food and eating habits play a major and prime role in the way we live our life and with what kind of lifestyle-healthy or unhealthy. A balanced diet consists of various constituents of food in accurate and appropriate quantity and quality according to the requirement of individual. It is easily digestible and contains appropriate ratio between proteins, fats and carbohydrates that is 1:1:4 for overall development of body in the fit proportion. The diet may vary from person to person according to the body requirements as per consultation from a dietician or family doctor.Intake of food and eating habits play a major and prime role in the way we live our life and with what kind of lifestyle-healthy or unhealthy. A balanced diet consists of various constituents of food in accurate and appropriate quantity and quality according to the requirement of individual. It is easily digestible and contains appropriate ratio between proteins, fats and carbohydrates that is 1:1:4 for overall development of body in the fit proportion. The diet may vary from person to person according to the body requirements as per consultation from a dietician or family doctor.','image-1709209953617.png','Himalaya','Mt. Everest','2024-03-08','18:04','18:07',231.000000,34,'8085872510',0,0,2,0,'2024-02-29 12:32:33'),(16,98,'Museum 2k244','Since the establishment of the earliest known museum in ancient times, museums have been associated with academia and the preservation of rare items. Museums originated as private collections of interesting items, and only much later did the emphasis on educating the public take root.','image-1709276050523.png','Indiaa','Delhii','2024-08-08','00:25','12:24',3319.000000,234,'8085872510',0,0,2,0,'2024-03-01 06:54:10'),(17,6,'Disco night','No-one can see the dance floor, it\'s wall to wall people dancing to the club music. There\'s no room for any more but somehow when Candy and I hit it the space magically comes. The music is all nineteen nineties but we\'re dancing like it\'s jive, twisting, turning, holding hands as we change sides. We\'re all grins, we look like idiots and we don\'t care. Inside we\'re just happy, happy and more alive than we can ever be in school. I feel the part of me that\'s really me come out to play, to feel the vibe of the music and let my body go free. One moment, one brilliant feeling of togetherness suspended in time. In ten years I\'ll still remember tonight, I love the quiet life but I relish the crazy fun times. Music, friends, good times, dance. Then I can focus in class, learn the facts, be the good girl. Can I help it of my soul loves a kickin\' beat?\r\n\r\n','image-1709550670263.png','vijay nagar','indore','2024-03-05','17:30','21:41',2500.000000,2,'9632514780',0,0,1,0,'2024-03-04 11:11:10'),(18,88,'Health Awarness Event','A morning walk can relieve joint stiffness, manage blood sugar and blood pressure, enhance blood flow to brain nerve cells, and strengthen bones and muscles. Obesity: Regular physical activity like morning walks helps reduce chronic health issues like cardiovascular disease and other metabolic diseases.','image-1709551774206.png','vijay nagar','indore','2024-03-13','19:00','22:01',1200.000000,2,'9632014587',0,0,2,0,'2024-03-04 11:29:34'),(19,98,'Grand Party','Party Invitation Messages: Parties are ways to celebrate different moments, achievements, success and important dates. Any party is incomplete without friends and loved ones. If you want your people to be with you in the jovial moment, you must invite them with love and respect. While writing the party invitation messages, keep this in mind because this represents how important your guests are for you.\r\n\r\nTo help you write an inspiring invitation message for the party you are organizing, we have made a collection of party invitation messages. So, why to send old party invitation messages when you have a striking one. Pick anyone to be different.','image-1709626734384.png','India','Delhi','2024-09-12','13:48','13:49',3467.000000,32,'8085872510',0,0,2,0,'2024-03-05 08:18:54'),(20,6,'Picnic','Test','image-1709648829532.png','Vijaynagar','Indore','2024-08-09','21:09','21:10',56.000000,46,'8085872510',0,0,1,0,'2024-03-05 14:27:09'),(21,6,'test','test','image-1724308662573.Screenshot from 2024-08-09 15-47-23.png','test','test','2024-06-01','20:15','21:15',0.000000,0,'8563214790',1,0,2,1,'2024-05-31 09:45:53');
