INSERT INTO `faq` VALUES (9,'What is Social System ?','society is believed to be grouped into structurally related groups or sets of roles, with different functions, meanings, or purposes. Examples of social structure include family, religion, law, economy, and class.','2023-08-17 12:17:27'),(12,'What are your payment methods?','Currently you can pay using your credit card (Visa, Mastercard and Amexco) via Stripe. We also accept payments via PayPal, TWINT and Apple Pay or you can transfer the amount to our bank account via direct bank transfer (advance payment). On your credit card statement, you will find your purchase listed as sent to LOREM NOT IPSUM MAGS (statement descriptor). Please take a look on the payments section for more details.\n\nNote: Additional fees may be charged by your bank when choosing direct bank transfer (advance payment).','2023-10-26 11:26:53');
