INSERT INTO `offersList` VALUES (1,26,2,'Friday Special ','Come on every Friday and get a 10% off','<p><strong>1.&nbsp;Applicability</strong> <br>1.1 The General Terms and Conditions below apply to all offers and transactions of Blue Pepper. Prices are subject to change. <br>1.2 By accepting an offer or making an order, the consumer expressly accepts the applicability of these General Terms and Conditions. <br>1.3 Deviations from that stipulated in these Terms and Conditions are only valid when they are confirmed in writing by the management. <br>1.4 All rights and entitlements stipulated for Blue Pepper&nbsp;in these General Terms and Conditions and any further agreements will also apply for intermediaries and other third parties deployed by Blue Pepper. <br><strong>2. Quality</strong> The restaurant guarantees that all the products offered meet the standards of the concept. If there are any complaints the management needs to be informed immediately. Appropriate actions will be taken as soon as possible. <br><strong>3. Prices/offers <br></strong>3.1 All offers made by Blue Pepper&nbsp;are without obligation and Blue Pepper&nbsp;expressly reserves the right to change the prices, in particular if this is necessary as a result of statutory or other regulations. <br>3.2&nbsp;All prices are indicated in euros, including VAT. <br>3.3 In certain cases, promotional prices apply. These prices are valid only during a specific period as long as stocks last. No entitlement to these prices may be invoked before or after the specific period. <br>3.4 Blue Pepper&nbsp;cannot be held to any price indications that are clearly incorrect, for example as a result of obvious typesetting or printing errors. No rights may be derived from incorrect price information. <br><strong>4. Cancellations <br></strong>4.1 Blue Pepper&nbsp;is entitled to cancel or change the date of an event. Should this happen, Blue Pepper&nbsp;will attempt to provide a suitable solution. If an event is cancelled or postponed, Blue Pepper&nbsp;will do its utmost to inform you as soon as possible. However, Blue Pepper cannot guarantee it is possible to inform you timely of any change or cancellation of an event or be held responsible for refunds, compensations or for any resulting costs you may incur, for example for travel, accommodation and/or any other related goods or service. <br>4.2 Before confirming your reservation, always check carefully that you have reserved&nbsp;the correct (number of) persons. Wrongfully ordered (numbers of) persons&nbsp;are not refundable. <br>4.3. All purchases are final. The dinner cruise tickets bought here cannot be returned for any refunds whatsoever; group bookings paid for on the website likewise cannot be cancelled by the purchaser and refunds claimed for any reason whatsoever. <br><strong>5. Payments</strong> <br>5.1 All prices are including VAT. <br>5.2&nbsp;Methods of payment we accept: Cash, iDeal, Mr. Cash, Maestro, Visa, Mastercard and American Express. <br>5.3&nbsp;You will not receive confirmation of your definitive booking until your payment has been approved.</p>','Nassaukade 366 | 1054 AB Indore','Indore ',120.00000000,'1744',0,2,8,2,'image-1709203000343.png',0,0,'2023-11-03 13:28:46'),(2,120,2,'Fitness','Looking for some Great Offer this Monsoon???\nHere you go...\nPurchase Annual Membership Online & get 50% Off plus 1 week of Quick Result Program. Well that\'s not all , this monsoon we are raining offers exclusive for you.\nAdd Promocode RAIN500 & get additional Rs. 500 Off on Online Purchase.\nSo what are you waiting for??  click the link below to Buy Now \nhttp://goldsgym.in/promo/monsoon-offer/?fbp\nT&C Applied\nOffer valid on selected locations only.\n#GoldsGym #GoldsGymIndia #MonsoonOffer #JulyOffer #Fitness #FitIndia #Discount #Offer #Health #YouComeFirst #117GymsStronger','<p><span style=\"color: rgb(5, 5, 5); font-family: Helvetica, Arial, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal;