INSERT INTO `privacyPolicy` VALUES (1,'<p style=\"line-height: 1.75em; margin-top: 0px; margin-bottom: 1.5em; color: rgb(48, 49, 53); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-size: 1.0625em;\"><span style=\"color: rgb(19, 16, 49); font-family: Rubik, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(241, 245, 248); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; float: none; display: inline !important; font-size: 24px;\"><strong style=\"background-color: rgb(255, 255, 255);\">Privacy Policy</strong></span></p><p style=\"line-height: 1.75em; margin-top: 0px; margin-bottom: 1.5em; color: rgb(48, 49, 53); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-size: 1.0625em;\"><strong style=\"font-weight: 700;\">Last updated: Oct 26</strong></p><p style=\"line-height: 1.75em; margin-top: 0px; margin-bottom: 1.5em; color: rgb(48, 49, 53); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-size: 1.0625em;\">This privacy notice (the <strong style=\"font-weight: 700;\">Privacy Notice</strong>) discloses the privacy practices for Generation: You Employed, Inc. (the <strong style=\"font-weight: 700;\">Organization</strong> or <strong style=\"font-weight: 700;\">We</strong>). It explains our practices for the collection, use, maintenance, protection, and disclosure of information that we may collect from you or that you may provide when you (1) visit our website:<span>&nbsp;</span><a href=\"http://global.generation.org/\" style=\"background-color: transparent; text-decoration: none; color: rgb(0, 116, 185); transition: color 0.2s ease 0s;\">http://global.generation.org/</a><span>&nbsp;</span>(the <strong style=\"font-weight: 700;\">Website</strong>) or (2) use any of our mobile or desktop applications (<strong style=\"font-weight: 700;\">Applications</strong>, and collectively with our Website, the <strong style=\"font-weight: 700;\">Platform</strong>).</p><p style=\"line-height: 1.75em; margin-top: 0px; margin-bottom: 1.5em; color: rgb(48, 49, 53); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-size: 1.0625em;\">This Privacy Notice applies to information collected by our Platform. It applies only to information that we collect: (1) on the Website, (2) on any of the Applications, and (3) via electronic message between you and the Platform (e.g. e-mail, text message, etc.). This Privacy Notice does not apply to information collected by: (1) us offline; (2) through any other website operated by the Organization or any third party (including our affiliates), or (3) by any third party (including our affiliates) that may link to or be accessible via the Platform.</p><p style=\"line-height: 1.75em; margin-top: 0px; margin-bottom: 1.5em; color: rgb(48, 49, 53); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-size: 1.0625em;\">This Privacy Notice will notify you of what personal information is collected from you through the Platform, how it is used and with whom it may be shared, as well as how you can correct any inaccuracies in the information. Please read this Privacy Notice carefully to understand our policies and practices regarding your information and how we will treat it. If you do not agree with our policies and practices, you may not elect to use either the Website or any of the Applications; if you do not agree with these policies and practices, you should immediately refrain from using the Website and you should remove and cease to use any of our Applications. This Privacy Notice may change from time to time. Your continued use of the Platform after we make changes is deemed to be acceptance of those changes, so please check back periodically for updates.</p><p style=\"line-height: 1.75em; margin-top: 0px; margin-bottom: 1.5em; color: rgb(48, 49, 53); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orp