r 0.2s ease 0s;\">http://global.generation.org/terms-of-use/</a>) which is also incorporated into your agreement with the Organization by this reference.</p><p style=\"line-height: 1.75em; margin-top: 0px; margin-bottom: 1.5em; color: rgb(48, 49, 53); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-size: 1.0625em;\"><strong style=\"font-weight: 700;\">Contact Details</strong></p><p style=\"line-height: 1.75em; margin-top: 0px; margin-bottom: 1.5em; color: rgb(48, 49, 53); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-size: 1.0625em;\">For the purposes of the EU General Data Protection Regulation, which regulates our use of your personal information, the Organization is considered the Data Controller. Our registered address is 1200 19th Street, NW, Suite 910, Washington, DC 20036, and should you have any comments or questions about how we collect and use your personal information, you should address them to<span>&nbsp;</span><a href=\"mailto:privacy@generation.org\" style=\"background-color: transparent; text-decoration: none; color: rgb(0, 116, 185); transition: color 0.2s ease 0s;\">privacy@generation.org</a>.</p><p style=\"line-height: 1.75em; margin-top: 0px; margin-bottom: 1.5em; color: rgb(48, 49, 53); font-family: Roboto, sans-serif; font-style