yle=\"background-color: transparent; text-decoration: none; color: rgb(0, 116, 185); transition: color 0.2s ease 0s;\">Terms of Use</a><span>&nbsp;</span>carefully to understand our policies and practices regarding your information and how we will treat it. By accepting our Privacy Notice and<span>&nbsp;</span><a href=\"https://www.generation.org/terms-of-use/\" style=\"background-color: transparent; text-decoration: none; color: rgb(0, 116, 185); transition: color 0.2s ease 0s;\">Terms of Use</a>, you are confirming that you have read and understand our policies including how and why we use your information. If you dont want us to collect or process your personal information in the ways described in this policy, you should not use the Platform. We are not responsible for the content or the privacy policies or practices of any of our members, third-party websites, or third-party apps.</p><p style=\"line-height: 1.75em; margin-top: 0px; margin-bottom: 1.5em; color: rgb(48, 49, 53); font-family: Roboto, sans-serif; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; font-size: 1.0625em;\">By using the Website and Platform, you acknowledge that the Organization will use your information in the United States and any other country where the Organization operates. Please be aware that the privacy laws and standards in certain countries, including the rights of authorities to access your personal information, may differ from those that apply in the country in which you reside. We will transfer personal information only to these countries to which we are permitted by law to transfer personal information, and we will take steps to ensure that your personal information continues to enjoy appropriate protections. Please read on to learn more about how we protect personal information thats transferred outside of Europe.</p>','2023-08-16 14:14:01');
